import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';
import logo from './entur_logo.jpg';
import Background from './background.jpg';
import SearchField from './searchField';

class NavBar extends React.Component {

    render() {
        return (
            <nav className="navBar">
                <div className="logo">
                    <img src={logo} width={180} height={80} alt="Entur" />
                </div>
            </nav>

        )
    }
}

class RegisterBox extends React.Component {
    constructor(props) {
        super(props);
        localStorage.setItem("type", "Linje");


        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        window.alert(event.target.value);
        localStorage.setItem('type', event.target.value);
    }

    handleSubmit(event) {
        alert('Your favorite flavor is: ' + this.state.value);
    }

    render() {
        return (
            <form onSubmit={this.handleSubmit}>
                <h3 className="text-center text-white">Registrer ny melding</h3>
                <br></br>
                <div className="form-row d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="fromDate p-2 flex-grow-1">
                        <p className="text-center text-white">Fra</p>
                        <input type="datetime-local" className="form-control"/>
                    </div>
                    <div className="toDate p-2 flex-grow-1">
                        <p className="text-center text-white">Til</p>
                        <input type="datetime-local" className="form-control"/>
                    </div>
                </div>
                <div className="message">
                    <p className="text-center text-white">Melding</p>
                    <input type="String" className="form-control" placeholder="Oppsummering"/>
                    <input type="String" className="form-control" placeholder="Beskrivelse"/>
                </div>
                <br></br>
                <div className="choose_type">
                    <p className="text-center text-white">Søk linje, stopp eller avgang</p>
                    <select className="browser-default custom-select" value={localStorage.getItem('type')} onChange={this.handleChange}>
                        <option value="Linje">Linje</option>
                        <option value="Stopp">Stopp</option>
                        <option value="Avgang">Avgang</option>
                    </select>
                </div>
                <SearchField />
                <br></br>
                <br></br>
                <div className="sumbit">
                    <button type="submit" className="btn btn-primary btn-lg btn-block">Submit</button>
                </div>
            </form>
        );
    }
}

class NewSX extends React.Component {
    render() {
        return (
            <div className="new_sx">
                <img id="background" src={ Background } alt="" />
                <div className="navBar">
                    <NavBar />
                </div>
                <div className="register_box" >
                    <RegisterBox />
                </div>
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <NewSX />,
    document.getElementById('root')
);
